// client/src/components/AdminDashboard.js
import React from 'react';
import { useNavigate } from 'react-router-dom';

function AdminDashboard({ setIsAuthenticated }) {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Token entfernen und ausloggen
    localStorage.removeItem('authToken');
    setIsAuthenticated(false);
    navigate('/login');
  };

  return (
    <div className="min-h-screen bg-gray-100">
      <nav className="bg-white shadow-md p-4">
        <div className="max-w-7xl mx-auto flex justify-between items-center">
          <h1 className="text-xl font-bold">Team Dashboard</h1>
          <button
            onClick={handleLogout}
            className="bg-red-500 hover:bg-red-700 text-white font-bold py-2 px-4 rounded"
          >
            Abmelden
          </button>
        </div>
      </nav>

      <div className="max-w-7xl mx-auto p-6">
        <div className="bg-white shadow-md rounded-lg p-6">
          <h2 className="text-lg font-semibold mb-4">Willkommen im Team-Bereich</h2>
          <p>Hier können deine Teammitglieder auf die relevanten Funktionen zugreifen.</p>

          {/* Hier kannst du die Hauptfunktionen deiner App einfügen */}
        </div>
      </div>
    </div>
  );
}

export default AdminDashboard;
